                                                                                                                                       ,('f3d6cdb9-7633-44d3-880e-fa915b17b71d','1.Care dintre urmatoarale afirmatii despre membrana celulara este incorecta?','A. componenta proteica a membranei celulare participa la mecanismele de transport transmembranar','B. miezul hidrofob restrictioneaza pasajul transmembranar al moleculelor hidrosolubile si al ionilor','C. fosfolipidele formeaza un bistrat, in interiorul caruia se afla cuprinsa portiunea lor hidrofila','D. proteinele pot fi dispuse si transmembranar','E. modelul structural membranar a fost denumit modelul mozaic fluid',3,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('866ed43a-ec07-4327-b51b-2e62fcd1d242','2.Potentialul de membrana al celulelor este generat de urmatorele, cu o exceptie:','A. permeabilitatea selectiva a membranei celulare','B. prezenta extracelulara a moleculelor nedifuzibile incarcate negativ','C. prezenta intracelulara a moleculeior nedifuzibile incarcate negativ','D. activitatea pompei Na+/K+','E. distributia inegala a sarcinilor electrice de o parte si de alta a membranei celulare',2,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('aa7238b9-811d-42db-8560-79d4eb6aea70','3.Repolarizarea celulei:','A. apare ca urmare a trecerii masive a Na+ dinspre exteriorul spre interiorul membrane celulare','B. este generata de deschiderea canalelor membranare pentru K+','C. este favorizata de deschiderea canalelor membranare pentru Na+','D. apare ca urmare a trecerii masive a K+ dinspre interiorul spre exteriorul membranei celulare','E. niciuna dintre afirmatille de mai sus nu este corecta',4,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('f868c88d-84d9-4177-ba5e-2bc7fe81a22d','4. Planul transversal:','A. Imparte corpul într-o parte anterioară (ventrala) si altă parte posteriora (dorsală)','B. imparte corpul intr-o parte superioara (craniala) si alta inferioara (caudala).','C. trece prin axul longitudinal si cel transversal','D. trece prin axul longitudinal si sagital','E. imparte corpul in doua jumatati simetrice',2,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('6b26b826-56a1-4fce-a903-b1a45874b4d2','5. Care dintre următoarele organite celulare au rol in sinteza proteică?','A, aparatul Golgi','B. mitocondriile','C. centrozomul','D. corpusculii lui Palade','E. lizozomii',4,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('00bfee9c-b87b-4a22-b223-dcc63044588b','6. Panta ascendentă a potentialului membranar de actiune:','A. apare ca urmare a cresterii permeabilitati membrane celulare pentru K+','B. apare ca urmare a scaderi activitatii pompei Na+/K+','C. apare ca urmare a cresterii permeabilitati membranei celulare pentru Na+','D. apare ca urmare a scaderii permeabilitati membranei celulare pentru Na+','E. apare ca urmare a scaderii permeabilitatii membranei atat pentru Na+, cat si pentru K+',3,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('6583f3db-0132-4864-aa76-3fc2f9669b62','7. Care dintre urmatoarele afirmatii referitoare la fosfolipidele din structura membranei celulare este falsă?','A. portiunea lor hidrofilă formează un bistrat','B. portinea hidrofobá restrictioneaza pasajul transmembranar al moleculelor hidrosolubile','C. sunt puternic incarcate negativ','D. portiunea hidrofobă este dispusa in interiorul bistratului alcătuit de portiunea hidrofilă','E. alcătuiesc, împreună cu proteinele modelul mozaic fluid al membranei celulare',3,NULL,NULL,NULL,NULL)
