                                                                                                                                       ,('4c8ebaca-5d17-4bcb-afca-9771832e317b','9. Despre tesutul epitelial nu se poate face următoarea afirmatie:','A. tesutul epitelial glandular (secretor) se gaseste in insulele Langerhans și in acinii pancreatici','B. Tesutul epitelial pseudostratificat se gaseste la nivelul traheei','C. uroteliul este un test epitelial glandular pluristratificat de tranzitie','D. tesutul epitelial senzorial intră in structura segmentului periferic al analizatorului kinestezic','E. Tesutul epitelial unistratificat cubic se găsește la nivelul mucoasei bronhiolelor.',4,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('fc04ca37-8e82-4a42-8acf-0c42421ad84b','10. Care dintre urmatoarele afirmatii referitoare la potentialul de membrana este adevarata?','A. potentialul membranar de repaus depinde de activitatea pompei Na+/K+, care reintroduce in celula Na+ difuzat la exterior si expulzează K+ pătruns in celula','B. modificarea temporara a potentialului de membrana se datoreaza unor curenti electrici care apar la trecerea ionilor prin canale membranare specifice, care se inchid sau se deschid in functie de potentialul de membrana','C. potentialul prag odata atins determina mentinerea unui potential membranar constant','D. valoarea potentialului de acțiune depinde de intensitatea stimulului','E. panta ascendenta a potentialului de actiune apare prin cresterea permesbilitati membrane pentru K+',2,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('02a856ee-41ef-4e22-b1b6-29fd4256263b','11. Transportul transmembranar de glucoză se realizează prin:','A. difuziune','B. osmoza','C. proteine transportoare','D. endocitoză','E. exocitoza',3,NULL,NULL,NULL,NULL)
