                                                                                                                                       ,('9ffa04da-825b-4322-9831-e3c1587c2115','14. Transportul transmembranar:','A. se realizeaza pasiv prin difuziune facilitata','B. asigura deplasarea moleculelor si a ionilor impotriva gradientelor lor de concentratie fără consum energetic','C. se poate realiza prin osmoză pentru ioni','D. pentru glucoza, se realizează prin difuziune','E. pentru moleculele organice polarizate, cu greutate moleculara mare este nesaturabil (nu e limitat de un transport maxim pentru o anumita substanta).',1,NULL,NULL,NULL,NULL)
                                                                                                                                       ,('03c84cd2-d4c5-4f4e-b220-4d44c1fd7646','15. Epitellul traheal este:','A. cu celule cubice','B. pavimentos','C. pseudostratificat','D. lax','E. semidur',3,NULL,NULL,NULL,NULL)
