                                                                                                                                       ,('89c7d8b1-f1c7-49d1-9b0c-080061ff9c2e','12. Selectati afirmatia incorecta:','A. deutoneuronul caii gustative este situat in nuclei solitar di bulo','B. In mugurele gustativ se aflá protoneuronul cai gustative','C. protoneuronul cari gustative se allá in ganglionul cranian al nervilor VII, IX si X','D. al (V-lea neuron al cali acustice se gáseste in corpui geniculat medial','E. aria vizualá primará se intinde mai ales pe fata medialã a lobilor accioitali.',NULL,NULL,NULL,NULL,NULL)
