                                                                                                                                       ,('e92e340e-8af8-47bf-82d2-1d67c250e082','11. Urmatoarea afirmatie cu privire la hipoderm este Incorecta:','A. este o páturà conjunctiva densa','B. reprezinta stratul profund al pielil','C. la nivelul sau se gâseso corpusculii Vater-Pacini','D. la nivelul sau se gásesc bulbit firului de pár','E. la nivelul sau se gáseso glomeruli glandelor sudoripare',NULL,NULL,NULL,NULL,NULL)
