                                                                                                                                       ,('92be8c01-8091-49c5-9c57-4d2a91212199','13. Receptorii analizatorulul olfactiv sunt:','A. chemoreceptor','G. terminati nervoase libere','O celule de susinere','D. celure multipolare','E celule cu conuri',NULL,NULL,NULL,NULL,NULL)
