                                                                                                                                       ,('ccf0644a-8c26-44af-b285-2f1965768ec0','15. Cand privim un oblect situat la o distanta mai mica de 6 m:','A. cristalinul se aplatizeaza','B. muschiul ollar se contracta si tensionaza ligamentul suspensor al cristalinului','C. puterea de convergenta creste la valoarea maximá','D. nu sunt implicati muschil irisului','E. centri corticali nu au niciun rol in acomodafie,',NULL,NULL,NULL,NULL,NULL)
