                                                                                                                                       ,('ae974b2f-7a41-46ec-9f02-a6672df1dd6b','17. Chiasma optica se formeaza prin incrucisarea:','A axonilor celulelor bipolane din campul intern (nazal) al retinei','B. axonilor neuronilor mullipolar proveniti din câmpul intern (nazal) al retinei','C. axoni neuronitor multipolari proveniti din câmpul extern. (temporal al refinei','D. axoni celulelor bipolare din câmpul extern (temporal) al retiner.','E. axonii neuronior din corpul geniculat extern',NULL,NULL,NULL,NULL,NULL)
